import React from 'react';

const Sidebar: React.FC = () => {
  return (
    <div className="fixed left-0 top-1/2 transform -translate-y-1/2 flex flex-col space-y-4">
      <a href="https://www.linkedin.com" className="text-[#61dafb] text-2xl" target="_blank" rel="noopener noreferrer">LinkedIn</a>
      <a href="https://www.github.com" className="text-[#61dafb] text-2xl" target="_blank" rel="noopener noreferrer">GitHub</a>
      <a href="https://www.medium.com" className="text-[#61dafb] text-2xl" target="_blank" rel="noopener noreferrer">Medium</a>
      <a href="https://www.youtube.com" className="text-[#61dafb] text-2xl" target="_blank" rel="noopener noreferrer">YouTube</a>
      <a href="mailto:email@example.com" className="text-[#61dafb] text-2xl">Email</a>
    </div>
  );
}

export default Sidebar;
